import React from 'react';
import './Post.css'
import { makeStyles } from '@material-ui/core/styles';
import Avatar from '@material-ui/core/Avatar';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    '& > *': {
      margin: theme.spacing(1),
    },
  },
}));

export default function ImageAvatars() {
  const classes = useStyles();
  const post__image = {
    width: "100%",
    objectFit: "contain",
  }
  const post__text = {
    fontWeight: "normal",
  }

  return (

    <div className="post">
        <Avatar alt="Remy Sharp" src="/static/images/avatar/1.jpg" />


      <h3>Username</h3>
        <img className="post__image" style={post__image} src="https://picsum.photos/536/354" alt="" />
        <h4 className="post__text" style={post__text}><b>Donald</b>: Random pictures</h4>
    </div>
  );
}
